export const setDoingTasks = doingTasks => ({ type: 'SET_DOING_TASKS', doingTasks });
export const deleteTask = id => ({ type: 'DELETE_TASK', id });
export const completeTask = id => ({ type: 'COMPLETE_TASK', id });
